char input() {
    return *p++;
}

void comment(void) {
	char c, prev = 0;
	while ((c = input()) != 0)      /* (EOF maps to 0) */
	{
		if (c == '/' && prev == '*')
			return;
		prev = c;
	}
	printf("unterminated comment");
}

void count(void) {
	int i;
	for (i = 0; yytext[i] != '\0'; i++)
		if (yytext[i] == '\n')
			column = 0;
		else if (yytext[i] == '\t')
			column += 8 - (column % 8);
		else
			column++;
}

void report_error(void) {
    printf("undefined token at %d, %d", line, column);
}

int main(int argc, char* argv[]) {
    if (argc!=2) {
	    printf("Usage: %s c_file_name",argv[0]);
	    exit(0);
	}
    FILE *rp = fopen(argv[1], "r");
    FILE *wp = fopen("token.txt", "w");
    if (rp == NULL) {
        printf("Reading Failure.");
        exit(0);
    }
    if (wp == NULL) {
        printf("Writing Failure.");
        exit(0);
    }
    char ch;
	int fileLen = 0;
	while (ch = fgetc(rp) != EOF) {
		++fileLen;
	}
	p = (char*)malloc(fileLen * sizeof(char) + 1);
	rewind(rp);
	for (int i = 0; i < fileLen; ++i) {
		p[i] = fgetc(rp);
	}
	p[fileLen] = '\0';
    while (*p) {
        fprintf(wp, "%d,%s\n", yylex(), yytext);
    }
    fclose(rp);
    fclose(wp);
    return 0;
}

